import React, { Component } from "react";
import "../style/style.css";

export class header extends Component {
  render() {
    return (
      <header>
        <div>
          <strong>DEMO</strong>
          <span>Site</span>
        </div>
        <nav>
          <ul>
            <li>
              <a href="#">Home</a>
            </li>
          </ul>
        </nav>
      </header>
    );
  }
}

export default header;
